// src/components/Nosotros.jsx
import React from 'react';

export default function Nosotros() {
  return (
    <section className="py-12 bg-white">
      <div className="max-w-3xl mx-auto px-4">
        <h2 className="text-3xl font-bold mb-4">Nosotros</h2>
        <p className="text-lg leading-relaxed">
          Somos una empresa especializada en licitaciones públicas y privadas, 
          ofreciendo productos de salud, plásticos industriales, transporte y 
          asesoría integral.
        </p>
      </div>
    </section>
  );
}
